import React from 'react';
import { BrowserRouter as Router, Switch, Route, Link } from "react-router-dom";

import Header from './Pages/Header';
import Home from './Pages/Home';
import { BookProvider } from './Contexts/Book';

function App() {
  return (
    <BookProvider>
      <Router>
        <div className="App">
          <Header />

          <Switch>
            <Route path="/">
              <Home />
            </Route>
          </Switch>
        </div>
      </Router>
    </BookProvider>
  );
}

export default App;
